import React from 'react';
import '../../sass/Tela1/tela1.css'
import CChassi from './CorrecaoChassi';
import CIProp from './CorrecaoInfoProp';
import CIVeic from './CorrecaoInfoVeic';
import CMuni from './CorrecaoMuni';
import CObs from './CorrecaoObservacaoCRLV';
import CRest from './CorrecaoRest';

const Tela5 = () => {
    
    const [tela1, setTela1] = React.useState(false);
    const [tela2, setTela2] = React.useState(false);
    const [tela3, setTela3] = React.useState(false);
    const [tela4, setTela4] = React.useState(false);
    const [tela5, setTela5] = React.useState(false);
    const [tela6, setTela6] = React.useState(false);

    const botaoOpt1 = () => {
        tela1 ? setTela1(tela1) : setTela1(!tela1);
        !tela2 ? setTela2(tela2) : setTela2(!tela2);
        !tela3 ? setTela3(tela3) : setTela3(!tela3);
        !tela4 ? setTela4(tela4) : setTela4(!tela4);
        !tela5 ? setTela5(tela5) : setTela5(!tela5);
        !tela6 ? setTela6(tela6) : setTela6(!tela6);
    }
    const botaoOpt2 = () => {
        !tela1 ? setTela1(tela1) : setTela1(!tela1);
        tela2 ? setTela2(tela2) : setTela2(!tela2);
        !tela3 ? setTela3(tela3) : setTela3(!tela3);
        !tela4 ? setTela4(tela4) : setTela4(!tela4);
        !tela5 ? setTela5(tela5) : setTela5(!tela5);
        !tela6 ? setTela6(tela6) : setTela6(!tela6);
    }
    const botaoOpt3 = () => {
        !tela1 ? setTela1(tela1) : setTela1(!tela1);
        !tela2 ? setTela2(tela2) : setTela2(!tela2);
        tela3 ? setTela3(tela3) : setTela3(!tela3);
        !tela4 ? setTela4(tela4) : setTela4(!tela4);
        !tela5 ? setTela5(tela5) : setTela5(!tela5);
        !tela6 ? setTela6(tela6) : setTela6(!tela6);
    }
    const botaoOpt4 = () => {
        !tela1 ? setTela1(tela1) : setTela1(!tela1);
        !tela2 ? setTela2(tela2) : setTela2(!tela2);
        !tela3 ? setTela3(tela3) : setTela3(!tela3);
        tela4 ? setTela4(tela4) : setTela4(!tela4);
        !tela5 ? setTela5(tela5) : setTela5(!tela5);
        !tela6 ? setTela6(tela6) : setTela6(!tela6);
    }
    const botaoOpt5 = () => {
        !tela1 ? setTela1(tela1) : setTela1(!tela1);
        !tela2 ? setTela2(tela2) : setTela2(!tela2);
        !tela3 ? setTela3(tela3) : setTela3(!tela3);
        !tela4 ? setTela4(tela4) : setTela4(!tela4);
        tela5 ? setTela5(tela5) : setTela5(!tela5);
        !tela6 ? setTela6(tela6) : setTela6(!tela6);
    }
    const botaoOpt6 = () => {
        !tela1 ? setTela1(tela1) : setTela1(!tela1);
        !tela2 ? setTela2(tela2) : setTela2(!tela2);
        !tela3 ? setTela3(tela3) : setTela3(!tela3);
        !tela4 ? setTela4(tela4) : setTela4(!tela4);
        !tela5 ? setTela5(tela5) : setTela5(!tela5);
        tela6 ? setTela6(tela6) : setTela6(!tela6);
    }

    return (
        <>
            <div className='tela--inicial--tela1'>
                <p className='item' onClick={botaoOpt1} >Correção das Observações do CRLV-E</p>
                <p className='item' onClick={botaoOpt2} >Correção de Chassi</p>
                <p className='item' onClick={botaoOpt3} >Correção de Informações do Proprietário</p>
                <p className='item' onClick={botaoOpt4} >Correção de Informações do Veículo</p>
                <p className='item' onClick={botaoOpt5} >Correção de Município</p>
                <p className='item' onClick={botaoOpt6} >Correção de Restrições</p>
            </div>
            {!tela1 ? null : <CChassi /> }
            {!tela2 ? null : <CIProp /> }
            {!tela3 ? null : <CIVeic /> }
            {!tela4 ? null : <CMuni /> }
            {!tela5 ? null : <CObs /> }
            {!tela6 ? null : <CRest /> }
        </>
    )
}

export default Tela5
